import * as React from "react";
import { ImageTile as ImageTileProps } from "../model";
import "../style.css";

export default function ImageTile({
  elementKey,
  title,
  source,
}: ImageTileProps) {
  return <img className="image" id={elementKey} src={source} alt={title} />;
}
